(function () {
  //   webp  background-img
  // 1. ,    Webp 
  function canUseWebp() {
    //   canvas
    let elem = document.createElement('canvas'); //     

    if (!!(elem.getContext && elem.getContext('2d'))) {
      //     webp,         
      return elem.toDataURL('image/webp').indexOf('data:image/webp') == 0;
    } //  Webp  


    return false;
  } // 2.   


  window.onload = function () {
    //     - data-bg
    let images = document.querySelectorAll('[data-bg]'); //   

    for (let i = 0; i < images.length; i++) {
      //    -
      let image = images[i].getAttribute('data-bg'); //      background-image    jpg

      images[i].style.backgroundImage = 'url(' + image + ')';
    } // ,      Firefox    


    let isitFirefox = window.navigator.userAgent.match(/Firefox\/([0-9]+)\./);
    let firefoxVer = isitFirefox ? parseInt(isitFirefox[1]) : 0; //    Webp   Firefox     65

    if (canUseWebp() || firefoxVer >= 65) {
      //         jpg,      Webp
      let imagesWebp = document.querySelectorAll('[data-bg-webp]');

      for (let i = 0; i < imagesWebp.length; i++) {
        let imageWebp = imagesWebp[i].getAttribute('data-bg-webp');
        imagesWebp[i].style.backgroundImage = 'url(' + imageWebp + ')';
      }
    }
  }; // :
  //<div style="background-image: url('/images/image.webp')" data-bg="/images/image.jpg" data-bg-webp="/images/image.webp"></div>

})();

